// import "./App.css";
import React, { useState, useEffect } from "react";

function App() {
  const [data, setData] = useState([{}]);
  const [message, setMessage] = useState("");

  useEffect(() => {
    fetch("/members")
      .then((res) => res.json())
      .then((data) => {
        setData(data);
        console.log(data);
      });
  }, []);

  return (
    <div>
      <p>{message.name}</p>

      {typeof data.members === "undefined" ? (
        <p>Loading...</p>
      ) : (
        data.members.map((member, i) => <p key={i}> {member}</p>)
      )}
    </div>
  );
}

export default App;
